import React from 'react'
// import { Component } from 'ag-grid-community';
// import GoogleLogin from 'react-google-login';
// or
import "../static/style.css"
import { GoogleLogin } from 'react-google-login';
const responseGoogle = (response) => {
    console.log(response);
}
class Register extends React.Component{
    constructor(props){
        super(props)
        this.state={
            name:'',
            email:'',
            imageUrl:''            
        }

        this.responseGoogle= this.responseGoogle.bind(this)
    }
    responseGoogle(data){
        console.log("got user")
        console.log("user data",data.profileObj);
        this.setState({
            name:data.profileObj.name,
            email:data.profileObj.email,
            imageUrl:data.profileObj.imageUrl
        })
    }
    onFailure(data){
        console.log(data)
    }
    render(){
        return(
            <React.Fragment>
                <h1> Register page</h1>
                    <div className="wrapper fadeInDown">
                        <div id="formContent">
                        {/* Tabs Titles */}
                        {/* Icon */}
                        <div className="fadeIn first">
                            <img src="https://png.pngtree.com/svg/20161229/_username_login_1172579.png" id="icon" alt="User Icon" />
                        </div>
                        {/* Login Form */}
                        <form>
                            <input type="text" id="login" className="fadeIn second" name="login" placeholder="login" />
                            <input type="text" id="password" className="fadeIn third" name="login" placeholder="password" />
                            <input type="submit" className="fadeIn fourth" defaultValue="Log In" />
                        </form>
                        <GoogleLogin
                            clientId="907270977097-68lm5uj9kim80gsrpto7ooblinntav7h.apps.googleusercontent.com"
                            buttonText="Login With Google"
                            className="btn btn-info btn-rounded btn-sm waves-effect waves-light"
                            onSuccess={this.responseGoogle}
                            onFailure={responseGoogle}
                            cookiePolicy={'single_host_origin'}
                        />,
                        {/* Remind Passowrd */}
                        <div id="formFooter">
                            <a className="underlineHover" href="#">Forgot Password?</a>
                        </div>
                        </div>
                    </div>
            </React.Fragment>
            
        );
    }
}
export default Register;
